// App.js
import React, { useState } from 'react';
import Collapsible from './Collapsible';

function App() {
  const [output1, setOutput1] = useState('');
  const [output2, setOutput2] = useState('');
  const [showFileInput, setShowFileInput] = useState(true);

  const handleFileUpload = async (event) => {
    const file = event.target.files[0];
    const formData = new FormData();
    formData.append('file', file);

    const response = await fetch('http://localhost:5000/upload', {
      method: 'POST',
      body: formData,
    });

    const data = await response.json();
    setOutput1(data.output1);
    setOutput2(data.output2);
    setShowFileInput(false);
  };

  const handleUploadAnotherFile = () => {
    setShowFileInput(true);
    setOutput1('');
    setOutput2('');
  };

  return (
    <div className="App">
      {showFileInput && <input type="file" onChange={handleFileUpload} />}
      {output1 && <Collapsible title="Output 1" content={output1} />}
      {output2 && <Collapsible title="Output 2" content={output2} />}
      {!showFileInput && (
        <button onClick={handleUploadAnotherFile}>Upload Another File</button>
      )}
    </div>
  );
}

export default App;
